import React,{useState,useContext} from 'react';
import ProductContext from '../productcontextapi/productcontext'
const Search = () => {
    const productcontext = useContext(ProductContext)
    const {productstate}= productcontext;
    console.log(productstate)
    const [key ,setkey] = useState("")
 const onSubmit = (e)=>{
      e.preventDefault();
 }
    return (
        <form className="form-inline" onSubmit={(e)=>onSubmit(e)}>
        <input style={{height:"35px"}} className="form-control p-1 rounded-pill border border-dark mr-4 w-55" type="search" placeholder="Search" aria-label="Search" value={key} onChange={(e)=>setkey({...key,key:e.target.value})} placeholder="Search By Typing"/>
        <button className="btn btn-outline-success btn-sm rounded mt-1" type="submit">Search</button>
        </form>
      );
}
 
export default Search;
